export default {
  name: 'watchShare',
  data: function data() {
    return {
      hasWatchToShow: false,
      watch: {}
    };
  },
  methods: {},
  computed: {},
  created: function created() {
    var _this = this;

    var urlParams = new URLSearchParams(window.location.search);
    var watchId = urlParams.get('watchId');
    this.$store.dispatch('getWatchShareById', watchId).then(function (watch) {
      console.log('got our watch', watch);
      _this.watch = watch;
      _this.hasWatchToShow = true;
    });
  }
};
